@yeadon_m you know too much immunology, so find it hard understand why the public doesn’t. There is one piece of actually useful sociology my wife taught me, which is the theory of “social representations” which are little narratives told between people to convince themselves they understand something (usually scientific) which in fact they don’t. The “social representation” has elements of truth but leaves critical factors out. It’s  a narrative “dumbed down” so far as to be wrong. In the early days of MRI a BBC report explained MRI as “making pictures with strong magnetic fields and radio”. Magnets and radios are commonplace, so the journalist’s tale works. But it isn’t true; the static fields don’t have to be strong, and (true) radio isn’t used at all.
Similarly with vaccines and antibodies. The “social representation” is the ancient “Jenner” narrative now culturally absorbed at primary school level. Vaccines encourage you to make antibodies against disease. Antibodies are the body’s “magic armour” made by the immune system. That’s why vaccines are harmless and wholly beneficial. They protect you and your children. We  even understand that antibodies are matching “lock and key” to antigens made by nasty germs. That’s how the immune system  works, doesn’t it ? T-cells and NK cells and macrophages - never heard of them. Eyes glaze over. If you want to make inroads into this, you have to accept that public understanding is a vague shadow at least a century out of date. It’s “magical thinking”. You have to say No No No it’s more complicated than that, and  develop a line that’s little more complicated than the “Jenner” narrative but adds to it by explaining how T-cells work, the innate immune response etc.
I took first year Cell Biology in 1975 at Cambridge, but remained largely ignorant of immunology until 2020 when I had to learn fast. Now consider how Joe Public without even GCSE Biology (or even Neil Ferguson) thinks about it, and develop that “social representation” so it’s a bit closer to the truth. That’s an urgent piece of messaging that HART could actually attempt.
